import axios from "axios"
import { GET_ERRORS} from "./types";

export const getBookings = bookingData => dispatch => {
    axios
      .post("http://localhost:5000/api/expert/bookings", {
        params: {
          expert_id: '5f89b74c785a191b10dab1ac',
          status: 'pending'
        }
    })
      .then(res => {
        console.log('-----res-------', res);
      })
      .catch(err =>
        dispatch({
          type: GET_ERRORS,
          payload: err.response.data
        })
      );
  };
